import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';

import './App';
import { Header } from './components/Header.jsx';

function App() {
    return (
        <Router>
            <div>
                <Header />
                <main>
                    <Switch>
                        <Route exact path="/">
                            <Home />
                        </Route>
                        <Route exact path="/blog"></Route>
                        <Route exact path="/contact"></Route>
                    </Switch>
                </main>
            </div>
        </Router>
    );
}

export default App;
